data:
  definition: circuit de sortie qui, lorsque le relais est à l'état de travail, est
    soit ouvert par un contact, soit à l'état bloqué, et qui, lorsque le relais est
    à l'état de repos, est soit fermé par un contact, soit à l'état passant
